import React from "react";
import Personal_Info from "./personal_info";
import Feature from "./feature";
import Header from "../Header/Header";
import Portfolio from "./portfolio";
import Resume from "./Resume/resume";
import CarouselWithContent from "./home_carousel";
import We_are from "./we_are";
const Home = () => {
  return (
    <div className="font-Optima h-[100vh]">
      <Header id="home" />
      <section id="home">
        <CarouselWithContent />
        {/* <Personal_Info /> */}
      </section>
      <section id="we_are">
        <We_are />
      </section>

      <section id="feature">
        <Feature />
      </section>
      <section id="portfolio">
        <Portfolio />
      </section>
      <section id="resume">
        <Resume />
      </section>
      <section id="clients">
        <h1>Clients Section</h1>
      </section>
      <section id="pricing">
        <h1>Pricing Section</h1>
      </section>
      <section id="blog">
        <h1>Blog Section</h1>
      </section>
      <section id="contact">
        <h1>Contact Section</h1>
      </section>
    </div>
  );
};

export default Home;
